#include <vector>
#include <cmath>

class Solution {
public:
    int numberOfBeautifulIntegers(int low, int high, int k) {
        int count = 0;
        // Precompute all beautiful numbers within the possible range
        std::vector<int> beautifulNumbers;
        for (int i = 1; i <= 1e9; ++i) {
            if (isBeautiful(i, k)) {
                beautifulNumbers.push_back(i);
            }
            // Optimization: Stop once the maximum possible value is reached
            if (i > high) break;
        }

        // Count beautiful numbers within the given range
        for (int num : beautifulNumbers) {
            if (num >= low && num <= high) {
                ++count;
            }
        }
        return count;
    }

private:
    bool isBeautiful(int num, int k) {
        if (num % k != 0) return false;

        int evenDigits = 0, oddDigits = 0;
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) ++evenDigits;
            else ++oddDigits;
            num /= 10;
        }
        return evenDigits == oddDigits;
    }
};
